import React, {Component} from 'react';
import {Grid, Cell} from 'react-mdl';

class About extends Component {
	render() {
		return(
			<div className='about-div'>
				<Grid className='about-grid' shadow={5}>
					<Cell col={5}>
					<img
						src='https://drive.google.com/uc?id=0B06V8RvrJYtTelhLVEk5WWQ0Tk9kaEdZamZfZkFaVTZyMTlV'
						alt='jump'
						style={{height:'250px', paddingTop:'2em', borderRadius:'15%', border:'3px solid grey'}}
					/>
					</Cell>
					<Cell col={7}>
						<h2>I'm an Adventurer </h2>
						<p>I love the outdoors, and hiking</p>
					</Cell>
					<Cell col={7}>
						<h2>I'm an Adventurer </h2>
						<p>I love the outdoors, and hiking</p>
					</Cell>
					<Cell col={5}>
						<img
							src='https://drive.google.com/uc?id=0B06V8RvrJYtTZ0hMelhOSjVMZUphTW15bW55bmlQd3Vab3BB'
							alt='jump'
							style={{height:'200px', paddingTop:'2em', borderRadius:'15%', border:'3px solid grey'}}
						/>
					</Cell>
				</Grid>
			</div>
		)
	}
}

export default About;
